// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.9;

contract Rechnung {
    string gesamtbetrag;
    string waehrung;
    address exporteur;
    address importeur;
    address zoll;
    string datum;
    string rechnungsposten;
    bool bestaetigt;
    constructor(string memory _gesamtbetrag, address _importeur,  address _zoll, string memory _waehrung, string memory _datum, string memory _rechnungsposten) public payable {
        gesamtbetrag= _gesamtbetrag;
        exporteur= msg.sender;
        importeur= _importeur;
        zoll= _zoll;
        waehrung= _waehrung;
        datum= _datum;
        rechnungsposten= _rechnungsposten;
        bestaetigt= false;
        }

    function getImporteur() public returns(address){
        return importeur;
    }

    function getGesamtbetrag(address _address) public returns(string memory){
        require(importeur == _address || exporteur == _address || _address == zoll);
        return gesamtbetrag;
    }

    //Erstellte Rechnung ist erst dann gültig, wenn der Importeur diese bestätigt 
    function confirmRechnung() public {
        require(
            importeur == msg.sender
            //"Nur 'Importeur' kann Rechnung bestätigen"
        );
        bestaetigt=true;
    }

    function getRechnung() public returns (string memory, address,  address, string memory, string memory, string memory, bool){
        require(importeur == msg.sender || exporteur == msg.sender || zoll == msg.sender);
        return(gesamtbetrag, importeur, zoll,  waehrung, datum, rechnungsposten, bestaetigt); 
    }
}

contract Zollanmeldung {
    address exporteur;
    address importeur;
    address anmelder;
    address zoll;
    uint zeitstempel;
    string zollwert;
    string transportkosten;
    bool bestaetigt;
    string incoterms;
    string gesamtbetrag;
    constructor(address _exporteur, address _zoll, address _rechnungaddress, string memory _zollwert, string memory _transportkosten, string memory _incoterms) public payable {
        Rechnung r = Rechnung(_rechnungaddress);
        require(r.getImporteur() == msg.sender);
        exporteur = _exporteur;
        importeur = msg.sender;
        anmelder= msg.sender;
        zoll = _zoll;
        zeitstempel = block.timestamp;
        zollwert = _zollwert;
        transportkosten = _transportkosten;
        bestaetigt = false;
        incoterms =_incoterms;
        //betrag wird aus Rechnung gezogen
        gesamtbetrag = r.getGesamtbetrag(msg.sender);
    }

    //Erstellte Zollanmeldung ist erst dann gültig, wenn der Zoll diese bestätigt
    function confirmZollanmeldung() public {
        require(
            zoll == msg.sender
            //"Nur Zoll kann Zollanmeldung bestätigen"
        );
        bestaetigt=true;
    }

    function getZollanmeldung() public returns (address, address, address, address, uint, string memory, string memory, bool, string memory, string memory){
        require(importeur == msg.sender || zoll == msg.sender);
        return(exporteur, importeur,anmelder, zoll,zeitstempel, zollwert, transportkosten, bestaetigt, incoterms, gesamtbetrag); 
    }
}

contract DokumentenHash{
    uint transaktionsID;
    string titel;
    string hash;
    address owner;
    address zoll;
    constructor(uint _transaktionsID, string memory _titel, string memory _hash, address _zoll) public payable {
        transaktionsID=_transaktionsID;
        titel = _titel;
        hash = _hash;
        owner = msg.sender;
        zoll = _zoll;
    }
}
